import Counter from './Counter';

import Stopwatch from "./Stopwatch"
import Countdown from "./Countdown"

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className = "App-title">Timers Demo</div>
        <div className = "Timers">
          <Stopwatch />
          <Countdown />
        </div>
      </div>
    );
  }
}

export default App;
